DROP TABLE IF EXISTS `main_table`;

CREATE TABLE `main_table` (
  `user_id` varchar(225) DEFAULT NULL,
  `Country_Org_of_UN_Registry` text,
  `Country_of_Operator_Owner` text,
  `Operator_Owner` text,
  `Users` text,
  `Purpose` text,
  `Date_of_Launch` text,
  `Expected_Lifetime_yrs` text,
  `Contractor` text,
  `Country_of_Contractor` text,
  `Launch_Site` text,
  `NORAD_Number` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `time` int(10) DEFAULT NULL,
  PRIMARY KEY (`NORAD_Number`),
  KEY `user_id` (`user_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



