DROP TABLE IF EXISTS `ID_table`;

CREATE TABLE `ID_table` (
  `Orbit_ID` INT,
  `NORAD_Number` int(11) unsigned NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`NORAD_Number`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `orbit_table`;

CREATE TABLE `orbit_table` (
    `Class_of_Orbit` VARCHAR(10) CHARACTER SET utf8,
    `Type_of_Orbit` VARCHAR(21) CHARACTER SET utf8,
    `Perigee_km` INT,
    `Apogee_km` INT,
    `Eccentricity` NUMERIC(16, 15),
    `Inclination_degrees` NUMERIC(5, 2),
    `Orbit_ID` int(11) unsigned NOT NULL AUTO_INCREMENT,
  PRIMARY KEY (`Orbit_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


